    <div className="filterBar">
    {props.searchQueryFilterBar.length>0 &&
      <div className="heading">
        По вашему запросу {props.searchQueryFilterBar} найдено {props.totalResults} результатов
      </div>
    }
      <div className="x4">
      </div>
      <div className="x2">
      </div>
    </div>
  )
}

export default FilterBar
